import styled from 'styled-components';

export default styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    .horizontal {
        display: flex;
        border: 1px solid red;
        width: 70vw;
    }
    .vertical {
        border: 1px solid black;
        height: 100%;
        width: 50%;
    }
    .text {
        padding: 10px;
    }

`;
